import React from 'react'
import {ToDoItem} from '../MyComponents/ToDoItem'


export const ToDOs = (props) => {
  return (
    <div className='container '>
      <h3 className='text-cente my-3'>Todos List</h3>
      {props.todos.map((x)=>{
        return   <ToDoItem  todo={x}/>
      })}
    
      
      
    </div>
  )
}
